import project1 from "../assets/project11.png";
import project2 from "../assets/project22.png";
import project3 from "../assets/project33.png";

const PROJECTS = [
  {
    id: 1,
    title: "Self Driving Car Software",
    description:
      "This is a fully functional self-driving car fuelled entirely by Deep Learning.",
    link: "https://github.com/Svaity/Self-Driving-Car-Software",
    image: project1
  },
  {
    id: 2,
    title: "ReactMusic",
    description:
      "A full-stack app from scratch with a GraphQL API made with Python (Django and Graphene), a React client app",
    link: "https://github.com/Svaity/ReactMusic",
    image: project2
  },
  {
    id: 3,
    title: "Pet adoption System",
    description:
      "Pet adoption system for shelters that makes it easy to track animal status, classify and manage animal data.",
    link: "https://github.com/Svaity/Pet-adoption-System",
    image: project3
  }
];

export default PROJECTS;
